/*Imports*/
import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

/*CSS import*/
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import '@fortawesome/fontawesome-free/css/all.css';

/*Component import*/
import MainDashboard from './components/MainDashboard/MainDashboard';
import MainTeams from './components/MainTeams/MainTeams';
import Settings from './components/Settings/Settings';
import Login from './sites/Login/Login';
import Home from './sites/Home/Home';
import MainProjects from './components/MainProjects/MainProjects';
import MainReports from './components/MainReports/MainReports';

export default class App extends Component {
   render() {
      return (
         <Router>
            <div className='App'>
               <Route exact path='/' component={Login} />
               <Route path='/login/' component={Login} />
               <Route path='/Home' component={Home} />
               <Route path='/MainDashboard/' component={MainDashboard} />
               <Route path='/Team/' component={MainTeams} />
               <Route path='/Project/' component={MainProjects} />
               <Route path='/Report/' component={MainReports} />
               <Route path='/Settings/' component={Settings} />
            </div>
         </Router>
      );
   }
}
